import React from 'react';

const Footer = () => {
    return (
        <div>
            <footer className="bg-dark fontifyw page-footer myfooter">
              Declare variables not wars
                <a href="https://github.com/Mgrdich"><i className="fab fa-github"/></a>
            </footer>
        </div>
    );
};

export default Footer;
